import React from "react";
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import About from "./components/About";
import Experience from "./components/Experience";
import Contact from "./components/Contact";
import NavbarComponent from "./components/Navbar"; // Update import
import Projects from "./components/Projects";
import Skills from "./components/Skills";
import Provenance from "./components/Provenance";
import PeopleWeave from "./components/PeopleWeave";
import TeamTech from "./components/TeamTech";
import ResearchBlog from "./components/ResearchBlog";
import "./App.css";
import './styles/fonts.css';

export default function App() {
  return (
    <BrowserRouter>
      <main>
        <div className="app-container" style={{backgroundColor: 'rgb(24, 23, 61'}}>
          <NavbarComponent />
          <Routes>
            <Route path="/" element={
              <>
                <div id="about" className="about-section">
                  <About />
                </div>
                <div id="skills" className="skills">
                  <Skills />
                </div>
                <div id="projects" className="projects-section">
                  <Projects />
                </div>
                <div id="experience" className="experience-section">
                  <Experience />
                </div>
                <div id="contact" className="contact-section">
                  <Contact />
                </div>
              </>
            } />
            <Route path="/provenance" element={<Provenance />} />
            <Route path="/peopleweave" element={<PeopleWeave />} />
            <Route path="/teamtech" element={<TeamTech />} />
            <Route path="/researchblog" element={<ResearchBlog />} />
          </Routes>
        </div>
      </main>
    </BrowserRouter>
  );
}
